const FileUpload = ()=>{

     const [file,setFile] = useState();

      const createJson = ()=>{
           const uploadedFile = file;
           console.log(file);
           if(uploadedFile!=null){
               const reader = new FileReader();
               
      
                
               reader.onload=(e)=>{
                    console.log(e.target.result);
               }
               reader.readAsText(uploadedFile);
           }
      }
     const inputHandler = (event)=>{
          setFile(event.target.files[0]);
          createJson();
          console.log(file);
     }
     return <Fragment>
           
           <form id="file-form">
           <input type="file" accept=".csv"  id="inputGroupFile02" onChange={e=>setFile(e.target.files[0])}/>
           </form>

             
           
     </Fragment>
}

